import Layout from "../components/Layout";

class Retrive extends React.Component {
  render() {
    <Layout>
      <div>
        <h1>About BitzPrice</h1>
        <p>Application to view Bitcoin prices</p>
      </div>
    </Layout>;
  }
}

export default Retrive;
